  false,\n\t\"url\": null,\n\t\"notes\": \"Estimates of area and aerial extent of
  land use categories are an essential component for computing the water budget of
  the High Plains aquifer. These raster land-use/land-cover data represent yearly
  simulated future land-use/land-cover for the High Plains from 2009 to 2050. These
  data were developed using the FOREcasting SCEnarios (FORE-SCE) of future land cover
  model (Sohl and others, 2007; Sohl and Sayler 2008) for two (A2 and B2) of the four
  Intergovernmental Panel on Climate Change (IPCC) climate scenarios and then processed
  using a Geographic Information System (GIS). The GIS software used to process these
  data was Environmental Systems Research Institute (ESRI, Inc.) ArcGIS Desktop 10.0.\",\n\t\"license_title\":
